<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
</head>
<body>
    <script>
        /**
         * @param {number} n
         * @return {string[]}
         */
        var generateParenthesis = function(n) {
            if (n === 0) {
                return [];
            }
            let totalList = [['none'], ['()']];
            for (let i = 2; i < n + 1; i++) {
                let list = [];
                for (let j = 0; j < i; j++) {
                    let list1 = totalList[j];
                    let list2 = totalList[i - 1 - j];
                    for (let k1 = 0; k1 < list1.length; k1++) {
                        for (let k2 = 0; k2 < list2.length; k2++) {
                            if (list1[k1] === 'none') {
                                list1[k1] = '';
                            }
                            if (list2[k2] === 'none') {
                                list2[k2] = '';
                            }
                            let el = '(' + list1[k1] + ')' + list2[k2];
                            list.push(el);
                        }
                    }
                }
                totalList.push(list);
            }
            return totalList[n];
        };
        console.log(generateParenthesis(3));

    </script>
</body>
</html>
